def preferencesFromName(name, allPreferences):
	if allPreferences == []:
		return []
	if name in allPreferences[0]:
		return allPreferences[0][1]
	else:
		return preferencesFromName(name,allPreferences[1:])

 
def rogue(proposers, choosers, matchings):
	if matchings == []:
		return False

	proposerpreference = preferencesFromName(matchings[0][0],proposers)
	chooserpreference = preferencesFromName(matchings[0][1],choosers)

	for i in range (len(matchings)):
		if proposerpreference.index(matchings[i][1]) < proposerpreference.index(matchings[0][1]) and preferencesFromName(matchings[i][1],choosers).index(matchings[0][0]) < preferencesFromName(matchings[i][1],choosers).index(matchings[i][0]):
			return [matchings[0][0],matchings[i][1]]
		if chooserpreference.index(matchings[i][0]) < chooserpreference.index(matchings[0][0]) and preferencesFromName(matchings[i][0],proposers).index(matchings[0][1]) < preferencesFromName(matchings[i][0],proposers).index(matchings[i][1]):
			return [matchings[i][0],matchings[0][1]]
	return rogue(proposers, choosers, matchings[1:])

def makeFreeList(input):
	free = []
	for i in range(len(input)):
		free += [input[i][0]]
	return free


# returns current partner of the person with name
def currentPartner(person, engaged):
	if engaged == []:
		return []
	for i in range(len(engaged)):
		if person in engaged[i]:
			for j in range(0,1):
				if person != engaged[i][j]:
					return engaged [i][j]



# returns the engaged pair of the person with name
def currentPair(name, engaged):
	for i in range(len(engaged)):
		if name in engaged[i]:
			return engaged[i]
	return False


def findMatchings(proposers, choosers):
	#p is proposer and c is chooser
	copyproposers = makeFreeList(proposers)
	copychoosers = makeFreeList(choosers)

	engaged = []

	while copyproposers != [] and copychoosers !=[]:

		firstchoice = preferencesFromName(copyproposers[0], proposers)[0]
		currentproposer = copyproposers[0]
		#if c is free

		if currentPair(preferencesFromName(currentproposer, proposers)[0], engaged) not in engaged:

		#p and c get engaged

			engaged.append([currentproposer, firstchoice])
			copyproposers.remove(currentproposer)
			copychoosers.remove(firstchoice)
		else:

		#means p' and w already exist

			if preferencesFromName(firstchoice, choosers).index(currentproposer) < preferencesFromName(firstchoice, choosers).index(currentPartner(firstchoice, engaged)):
				# c prefers p to p'

				copyproposers.append(currentPartner(firstchoice, engaged))
				copyproposers.remove(currentproposer)
				del engaged[engaged.index(currentPair(firstchoice, engaged))]
				engaged.append([currentproposer, firstchoice])

			#move p' back to proposers and then match c and p

			else:
				proposers[proposers.index(currentPair(currentproposer,proposers))][1].remove(firstchoice)
				#p' and c remain engaged and delete preferences
	return engaged


